CURRENT FRAGRANCE OBSESSIONS 😳

@manosgerakinisparfums Immortelle: a sweet, warm-spicy, and creamy mixture of maple syrup-like Immortelle, milk, cinnamon, and brown sugar. Delicious.

@fragrancedubois Secret Tryst: resinous and ambery, a little wispy and transparent via incense, and a bit soft and floral. Alluring.

#tomfordperfume Tobacco Oud: dark, spicy and woody, with a slightly sweet, boozy warmth by way of whiskey and ambery notes. Authoritative.

@vertusperfume Vanilla Oud: this has been inducted into my top 5 favorite vanillas of all time. A rich, almost burnt creamy sweetness with the illusion of bourbon is deepens by a soft medicinal oud. Intoxicating.

@alghabra_parfums Scent of Paradise: a notable resemblance to Creed’s famed Silver Mountain Water, but a softer, more citrusy, and more floral identity. Refreshing.

Let me know if you’ve tried any of these 👇🏾

